{
  "judgement": "sí",
  "continuation": "Pasó ya la estación de los amores
Y la edad de los sueños placentera;
Pasó la deliciosa primavera,
Y con ella los frutos y las flores.

Pasó la edad en que esperé lograr
La esperanza que el alma me engañaba;
Pasó la edad en que pude alcanzar
La dicha que el amor me prometía."
}
